import styled from "styled-components";
import React from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
import Profile from "../assets/depression3747_hitpaw.com.png";
import Ogo from "../assets/logo.png";
import Person3Icon from "@mui/icons-material/Person3";
import Userinfo from "../Componenst/Userinfo"


function Nav2() {
  const [theme, setTheme] = useState("light");

  useEffect(() => {
    if (theme === "light") {
      document.body.classList.remove("dark");
    } else {
      document.body.classList.add("dark");
    }
  }, [theme]);

  function toggleTheme() {
    if (theme === "light") {
      setTheme("dark");
    } else {
      setTheme("light");
    }
  }

  const navigate = useNavigate();

  const handleAccountClick = (event) => {
    event.preventDefault();
    navigate("/account/my-account");
  };
  return (

     <>
     <nav>

        <Userinfo/>

        <div className="">
            {/* <img src={Profile}/> */}
            <img src={Ogo} className="l"/>

          </div>

          <Home to="/home">Home</Home>

          <About to="/about">About</About>

          <Advices to="/advices">Advices</Advices>

          <Contact to="/Quiz">Test</Contact>

     </nav>
     </>   
  );
}

export default Nav2;
